import ReactDOM from "react-dom";


ReactDOM.render(<div>
  <h1>Rihan Netflix collection</h1>
  <p>List of 5 best series</p>
  <ol>
    <li>Rihan</li>
  </ol>
</div>, document.getElementById('root'));
